uniform float iTime;
uniform vec2 iResolution;
uniform vec4 iMouse;
uniform sampler2D iChannel0;

// Parameter uniforms
uniform float u_speed;
uniform float u_growth;
uniform float u_flesh_detail;
uniform float u_slime_gloss;
uniform float u_particle_count;
uniform float u_camera_dist;
uniform float u_blood_tint;

out vec4 fragColor;

// --- UTILS ---
mat2 rot(float a) { return mat2(cos(a), -sin(a), sin(a), cos(a)); }

float hash(vec3 p) {
    p = fract(p * 0.3183099 + 0.1);
    p *= 17.0;
    return fract(p.x * p.y * p.z * (p.x + p.y + p.z));
}

float noise(vec3 x) {
    vec3 i = floor(x);
    vec3 f = fract(x);
    f = f * f * (3.0 - 2.0 * f);
    return mix(mix(mix(hash(i + vec3(0, 0, 0)), hash(i + vec3(1, 0, 0)), f.x),
                   mix(hash(i + vec3(0, 1, 0)), hash(i + vec3(1, 1, 0)), f.x), f.y),
               mix(mix(hash(i + vec3(0, 0, 1)), hash(i + vec3(1, 0, 1)), f.x),
                   mix(hash(i + vec3(0, 1, 1)), hash(i + vec3(1, 1, 1)), f.x), f.y), f.z);
}

float fbm(vec3 p) {
    float v = 0.0;
    float a = 0.5;
    for (int i = 0; i < 4; i++) {
        v += a * noise(p);
        p *= 2.0;
        a *= 0.5;
    }
    return v;
}

// --- SDF FUNCTIONS ---
float sdSphere(vec3 p, float s) { return length(p) - s; }

float sdCappedCone(vec3 p, float h, float r1, float r2) {
    vec2 q = vec2(length(p.xz), p.y);
    vec2 k1 = vec2(r2, h);
    vec2 k2 = vec2(r2 - r1, 2.0 * h);
    vec2 ca = vec2(q.x - min(q.x, (q.y < 0.0) ? r1 : r2), abs(q.y) - h);
    vec2 cb = q - k1 + k2 * clamp(dot(k1 - q, k2) / dot(k2, k2), 0.0, 1.0);
    float s = (cb.x < 0.0 && ca.y < 0.0) ? -1.0 : 1.0;
    return s * sqrt(min(dot(ca, ca), dot(cb, cb)));
}

// Demogorgon Petal logic
float petal(vec3 p, float angle) {
    p.xy *= rot(angle);
    float open = u_growth + sin(iTime * u_speed * 1.5) * 0.2;
    p.yz *= rot(open);
    p.y -= 1.0;

    // Flesh distortion
    p.x += (fbm(p * 2.0 + iTime * 0.2) - 0.5) * 0.15 * u_flesh_detail;

    float d = sdCappedCone(p, 1.2, 0.2, 0.6);

    // Teeth (small spikes)
    float teeth = 1e10;
    vec3 tp = p;
    tp.y = mod(tp.y, 0.2) - 0.1;
    teeth = length(vec2(length(tp.xz) - 0.2, tp.y)) - 0.05;

    return min(d, teeth);
}

// Scene Map
float map(vec3 p) {
    // Body / Torso
    float body = sdCappedCone(p + vec3(0.0, 3.5, 0.0), 2.5, 0.4, 0.8);
    body = min(body, sdSphere(p + vec3(0, 0.5, 0), 0.8)); // Neck area

    // Petals (The "Flower" Face)
    float petals = 1e10;
    for(float i=0.0; i<5.0; i++){
        petals = min(petals, petal(p, i * (6.28318 / 5.0)));
    }

    // Flesh noise displacement
    float disp = fbm(p * 3.0) * 0.1 * u_flesh_detail;

    return min(body, petals) - disp;
}

vec3 getNormal(vec3 p) {
    vec2 e = vec2(0.001, 0.0);
    return normalize(vec3(
        map(p + e.xyy) - map(p - e.xyy),
        map(p + e.yxy) - map(p - e.yxy),
        map(p + e.yyx) - map(p - e.yyx)
    ));
}

void main() {
    vec2 uv = (gl_FragCoord.xy - 0.5 * iResolution.xy) / iResolution.y;
    float time = iTime * u_speed;

    // Camera Rail Logic
    float camDist = u_camera_dist;
    vec3 ro = vec3(sin(time * 0.2) * 2.0, 1.0 + cos(time * 0.3), camDist);
    vec3 ta = vec3(0.0, 0.0, 0.0);

    // Jitter for horror effect
    ro += (vec3(hash(vec3(time)), hash(vec3(time+1.0)), hash(vec3(time+2.0))) - 0.5) * 0.02;

    vec3 f = normalize(ta - ro);
    vec3 r = normalize(cross(vec3(0, 1, 0), f));
    vec3 u = cross(f, r);
    vec3 rd = normalize(f + uv.x * r + uv.y * u);

    // Raymarching
    float t = 0.0;
    float d = 0.0;
    for(int i=0; i<80; i++) {
        d = map(ro + rd * t);
        if(d < 0.001 || t > 20.0) break;
        t += d;
    }

    // Background (The Upside Down)
    vec3 bg = vec3(0.02, 0.01, 0.01);
    // Add floating "ash" particles
    float ash = fbm(vec3(uv * 5.0, time * 0.5));
    bg += smoothstep(0.4, 0.5, ash) * 0.1 * u_particle_count;

    vec3 col = bg;

    if(t < 20.0) {
        vec3 p = ro + rd * t;
        vec3 n = getNormal(p);
        vec3 lightPos = vec3(5.0, 5.0, 5.0);
        vec3 l = normalize(lightPos - p);

        // Lighting
        float diff = max(dot(n, l), 0.0);
        float spec = pow(max(dot(reflect(-l, n), -rd), 0.0), u_slime_gloss);
        float rim = pow(1.0 - max(dot(n, -rd), 0.0), 3.0);

        // Base Flesh Color (Greyish pink/brown)
        vec3 fleshBase = vec3(0.4, 0.3, 0.3);
        float blood = fbm(p * 2.0) * u_blood_tint;
        fleshBase = mix(fleshBase, vec3(0.3, 0.02, 0.01), blood);

        // Face interior is bloodier
        if(length(p.xy) < 1.2 && p.z > -0.5) {
             fleshBase = mix(fleshBase, vec3(0.5, 0.0, 0.0), 0.6);
        }

        col = fleshBase * diff;
        col += spec * vec3(0.8, 0.9, 1.0) * 0.5; // Slimy highlight
        col += rim * vec3(0.5, 0.4, 0.4);       // Subsurface look

        // Ambient Occlusion trick
        float ao = clamp(map(p + n * 0.2) / 0.2, 0.0, 1.0);
        col *= ao;

        // Depth fog
        col = mix(col, bg, 1.0 - exp(-0.15 * t));
    }

    // Vignette
    col *= 1.0 - length(uv) * 0.5;

    // Flashlight flicker effect
    float flicker = step(0.1, fract(sin(time * 10.0)));
    col *= 0.8 + 0.2 * flicker;

    // Contrast / Color Grade
    col = pow(col, vec3(0.9));
    col *= 1.2;

    fragColor = vec4(col, 1.0);
}
